import 'bootstrap/dist/css/bootstrap.min.css';
import './card-list.component.css';

class CardList extends Component {
    render(){
        const {fileteredMonsters} = this.props;
   return(
       <div className="container">
           <div className="row">
               <div className="col-3">
                   { fileteredMonsters.map(monster => <h5 key={monster.id}>{monster.name}</h5>)}
               </div>
           </div>
       </div>
   );
}
   }
export default CardList;
